import React from "react";
export default function Encabezado(){
    return(
        <head className="cabecera">
            <div className="logo">
                <img src="" alt="logo-consultorio"/>
            </div>
            <div className="Menu">
                <a>Inicio</a>
                <a>Sobre Nosotros</a>
                <a>Experiencias</a>
                <a>Contactanos</a>
            </div>
        </head>
    );
};
